/// <summary>
/// Initializes the history record based on a <c>PurchLine</c> record.
/// </summary>
/// <param name="_purchLine">
/// A <c>PurchLine</c> record to initialize based on.
/// </param>
public void initFromPurchLine(PurchLine _purchLine)
{
    PurchLineMap_W          purchLineMap_W;
    PurchLineHistory_W      purchLineHistory_W;
    PurchLineMap_IN         purchLineMap_IN;
    PurchLineHistory_IN     purchLineHistory_IN;

    this.purchLineVersioning().copyVersion(_purchLine.purchLineVersioning());

    if (PurchLineHistory_IN::isExtensionEnabled())
    {
        purchLineMap_IN.data(_purchLine.purchLine_IN());
        purchLineHistory_IN.data(purchLineMap_IN.data());
        this.SysExtensionSerializerMap::packExtensionTable(purchLineHistory_IN);
    }
    if (PurchLineHistory_W::isExtensionEnabled())
    {
        purchLineMap_W.data(_purchLine.purchLine_W());
        purchLineHistory_W.data(purchLineMap_W.data());
        this.SysExtensionSerializerMap::packExtensionTable(purchLineHistory_W);
    }
}

public void insert()
{
    ttsbegin;
    super();
    this.SysExtensionSerializerMap::postInsert();
    ttscommit;
}

