/// <summary>
/// Initializes a <c>PurchLine</c> record with the same field values as the current <c>PurchLineHistory</c> record.
/// </summary>
/// <returns>
/// A <c>PurchLine</c> record.
/// </returns>
/// <remarks>
/// The method is private as external use could be wrong as the record does not exist in the database.
/// </remarks>
private PurchLine purchLineOrig()
{
    PurchLine purchLine;

    purchLine.initFromPurchLineHistory(this);

    return purchLine;
}

