/// <summary>
/// Determines whether the specified <c>PurchLine</c> record has any history stored in the <c>PurchLineHistory</c> table.
/// </summary>
/// <param name="_purchLine">
/// A <c>PurchLine</c> record for which to check existance of its history versions.
/// </param>
/// <returns>
/// true if history of the specified record exists; otherwise, false.
/// </returns>
public static boolean  exist(PurchLine _purchLine)
{
    if (_purchLine.InventTransId)
    {
        return (select firstonly purchLineHistory
                    where purchLineHistory.InventTransId == _purchLine.InventTransId).RecId != 0;
    }

    return false;
}

/// <summary>
/// Determines whether the specified <c>PurchLine</c> record has any history in the <c>PurchLineHistory</c> table.
/// </summary>
/// <param name="_inventTransId">
/// A <c>TradeInventTransId</c> value for which to check existance of the corresponding line history.
/// </param>
/// <returns>
/// true if history of the line with specified <c>TradeInventTransId</c> value exists; otherwise, false.
/// </returns>
public static boolean existFromInventTrans(TradeInventTransId _inventTransId)
{
    PurchLineHistory purchLineHistory;

    select firstonly RecId from purchLineHistory
        where purchLineHistory.InventTransId == _inventTransId;

    return purchLineHistory.RecId;
}

/// <summary>
/// Finds the specified record in the <c>PurchLineHistory</c> table.
/// </summary>
/// <param name="_purchLine">
/// A <c>PurchLine</c> record for which to find its history version.
/// </param>
/// <param name="_validTime">
/// A time for which to find a valid history version.
/// </param>
/// <returns>
/// A <c>PurchLineHistory</c> record if one exists; otherwise an empty record.
/// </returns>
public static PurchLineHistory find(PurchLine _purchLine, utcdatetime _validTime = DateTimeUtil::utcNow())
{
    PurchLineHistory purchLineHistory;

    if (_purchLine.InventTransId)
    {
        select firstonly validTimeState(_validTime) purchLineHistory
            where purchLineHistory.InventTransId            == _purchLine.InventTransId;
    }

    return purchLineHistory;
}

/// <summary>
/// Finds the specified record in the <c>PurchLineHistory</c> table.
/// </summary>
/// <param name="_recId">
///     A record identifier of the record to find.
/// </param>
/// <param name="_forUpdate">
///     A Boolean value that indicates whether to select the returned record for update; optional.
/// </param>
/// <returns>
/// A <c>PurchLineHistory</c> record if one exists; otherwise an empty record.
/// </returns>
static PurchLineHistory findRecId(RecId       _recId,
                                  boolean     _forUpdate = false)
{
    PurchLineHistory    purchLineHistory;
    utcdatetime         minValue = DateTimeUtil::minValue();
    utcdatetime         maxValue = DateTimeUtil::maxValue();

    purchLineHistory.selectForUpdate(_forUpdate);

    select validTimeState(minValue, maxValue) purchLineHistory
        where purchLineHistory.RecId == _recId;

    return purchLineHistory;
}

